import React from 'react';

const Navbar=(props)=> {
  
    
    return (
      <div style={styles.nav}>
        <div style={styles.cartIconContainer}>
            <img style={styles.cartIcon} src='https://cdn-icons-png.flaticon.com/128/891/891462.png' alt='cart-icon'/>
            <span style={styles.cartCount}>3</span>
        </div>
      </div>
    );

}

const styles = {
    cartIcon: {
      height: 32,
      marginRight: 20
    },
    nav: {
      height: 70,
      background: '#293752',
      display: 'flex',
      justifyContent: 'flex-end',
      alignItems: 'center'
    },
    cartIconContainer: {
      position: 'relative'
    },
    cartCount: {
      background: 'yellow',
      borderRadius: '50%',
      padding: '4px 8px',
      position: 'absoloute',
      right: 0,
      top: -9
    }
  };
  
export default Navbar;
